import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";
import "./Dashboard.css";
import SignupPage from "./Signup";
import LoginPage from "./Login";
import SlotBookingPage from "./SlotBookingPage";
import BookingHistoryPage from "./bookingHistoryPage";
import WelcomeImage from "../images/img2.webp";
import Logo from "../images/logo.webp";

const Dashboard = () => {
  const [activePage, setActivePage] = useState(null);
  const [typedText, setTypedText] = useState("");
  const [user, setUser] = useState(null);
  const [activeReservation, setActiveReservation] = useState(null);
  const [remainingTime, setRemainingTime] = useState(null);
  const navigate = useNavigate();
  const fullText = "Welcome to SmartParking!!!";

  // Typing Effect
  useEffect(() => {
    let index = 0;
    const typingInterval = setInterval(() => {
      if (index < fullText.length) {
        setTypedText(fullText.slice(0, index + 1));
        index++;
      } else {
        clearInterval(typingInterval);
      }
    }, 100);
    return () => clearInterval(typingInterval);
  }, []);

  // Fetch user profile
  useEffect(() => {
    const token = localStorage.getItem("token");
    if (!token) return navigate("/login");

    axios
      .get("http://localhost:5000/routes/profile", {
        headers: { Authorization: `Bearer ${token}` },
      })
      .then((response) => {
        setUser(response.data.user);
        localStorage.setItem("userId", response.data.user.id);
      })
      .catch((error) => {
        console.error("Profile fetch error:", error);
        localStorage.removeItem("token");
        localStorage.removeItem("userId");
        navigate("/login");
      });
  }, [navigate]);

  // Fetch active reservation
  useEffect(() => {
    const token = localStorage.getItem("token");
    if (!token) return;

    axios
      .get("http://localhost:5000/routes/reserve", {
        headers: { Authorization: `Bearer ${token}` },
      })
      .then((response) => {
        if (Array.isArray(response.data.slots) && response.data.slots.length > 0) {
          const reservation = response.data.slots[0];
          setActiveReservation(reservation);
          setRemainingTime(reservation.remainingTime || 0);
        } else {
          setActiveReservation(null);
        }
      })
      .catch((error) => console.error("Reservation fetch error:", error));
  }, []);

  // Countdown Timer
  useEffect(() => {
    if (!remainingTime || remainingTime <= 0) return;

    const interval = setInterval(() => {
      setRemainingTime((prevTime) => Math.max(prevTime - 1000, 0));
    }, 1000);

    return () => clearInterval(interval);
  }, [remainingTime]);

  // Logout
  const handleLogout = () => {
    localStorage.removeItem("token");
    localStorage.removeItem("userId");
    setUser(null);
    navigate("/");
  };

  // Extend Reservation
  const handleExtendReservation = () => {
    axios
      .post(
        "http://localhost:5000/routes/extend-reservation",
        { userId: localStorage.getItem("userId") },
        { headers: { Authorization: `Bearer ${localStorage.getItem("token")}` } }
      )
      .then((response) => {
        setRemainingTime(response.data.newRemainingTime);
        alert("Reservation extended successfully!");
      })
      .catch((error) => {
        console.error("Extend reservation error:", error);
        alert("Could not extend reservation.");
      });
  };

  // Cancel Reservation
  const handleCancelReservation = () => {
    axios
      .post(
        "http://localhost:5000/routes/cancel-reservation",
        { userId: localStorage.getItem("userId") },
        { headers: { Authorization: `Bearer ${localStorage.getItem("token")}` } }
      )
      .then(() => {
        setActiveReservation(null);
        alert("Reservation canceled successfully!");
      })
      .catch((error) => {
        console.error("Cancel reservation error:", error);
        alert("Could not cancel reservation.");
      });
  };

  // Profile Page
  const renderProfile = () => {
    if (!user) return <p>Loading...</p>;

    return (
      <div className="profile-card">
        <h2>Profile Details</h2>
        <p><strong>Name:</strong> {user.name}</p>
        <p><strong>Email:</strong> {user.email}</p>
        <p><strong>Phone:</strong> {user.phone || "Not provided"}</p>
        <button onClick={handleLogout} className="logout-btn">Logout</button>
      </div>
    );
  };

  // Dynamic Content Rendering
  const renderContent = () => {
    if (activePage === "login") return <LoginPage />;
    if (activePage === "signup") return <SignupPage />;
    if (activePage === "slotBooking") return <SlotBookingPage />;
    if (activePage === "history") return <BookingHistoryPage />;
    if (activePage === "profile") return renderProfile();

    if (activeReservation) {
      return (
        <div className="reservation-card">
          <h2>Active Reservation</h2>
          <p><strong>Slot:</strong> {activeReservation.slotNumber}</p>
          <p>
            <strong>Time Left:</strong> {Math.floor(remainingTime / 60000)} min{" "}
            {Math.floor((remainingTime % 60000) / 1000)} sec
          </p>
          <div className="reservation-actions">
            <button onClick={() => navigate("/map")}>View Map</button>
            <button onClick={handleExtendReservation}>Extend</button>
            <button onClick={handleCancelReservation} className="cancel-btn">
              Cancel
            </button>
          </div>
        </div>
      );
    }

    return (
      <div className="welcome-section">
        <div className="welcome-text">
          <h1 className="typing-effect">{typedText}</h1>
          <p className="fade-in">
            Discover a smarter way to park. Save time, reduce hassle, and enjoy effortless parking at your fingertips.
          </p>
          <button onClick={() => setActivePage("signup")}>Get Started</button>
        </div>
        <div className="welcome-image">
          <img src={WelcomeImage} alt="Smart Parking" />
        </div>
      </div>
    );
  };

  return (
    <div className="home-page">
      <nav className="navbar">
        <img src={Logo} alt="SmartPark Logo" className="navbar-logo" />
        <div className="navbar-links">
          <button className={`navbar-btn ${activePage === null ? "active" : ""}`} onClick={() => setActivePage(null)}>Home</button>
          <button className={`navbar-btn ${activePage === "slotBooking" ? "active" : ""}`} onClick={() => setActivePage("slotBooking")}>Slot Booking</button>
          <button className={`navbar-btn ${activePage === "history" ? "active" : ""}`} onClick={() => setActivePage("history")}>History</button>
          <button className={`navbar-btn ${activePage === "profile" ? "active" : ""}`} onClick={() => setActivePage("profile")}>Profile</button>
        </div>
      </nav>
      <div className="content-area">{renderContent()}</div>
    </div>
  );
};

export default Dashboard;
